@đều
- I t. 1 Có kích thước, số lượng, thành phần, v.v. bằng nhau, như nhau. Bông lúa to, hạt đều và chắc. Chia thành hai phần đều nhau. Kế hoạch dàn đều, thiếu trọng tâm. Hai đội đá hoà 1 đều (mỗi bên một bàn thắng như nhau). 2 Có tốc độ, nhịp độ, cường độ như nhau hoặc trước sau không thay đổi, hoặc lặp đi lặp lại sau từng thời gian nhất định y như nhau. Máy chạy đều. Các diễn viên múa rất đều. Quay cho đều tay, đừng khi nhanh khi chậm. Tập thể dục đều các buổi sáng. Giọng kể đều đều. 3 (chm.). (Hình tam giác, đa giác) có tất cả các cạnh bằng nhau và tất cả các góc bằng nhau. Tam giác đều. Lục giác đều.
- II p. 1 Từ biểu thị tính đồng nhất về hoạt động, trạng thái hoặc tính chất của nhiều đối tượng khác nhau; thảy như nhau, cùng giống như nhau. Mọi người  cười. Hai cái bút đều tốt cả. 2 Từ biểu thị tính đồng nhất về hoạt động, trạng thái hoặc tính chất của cùng một đối tượng, trong những hoàn cảnh khác nhau; lần nào cũng như lần nào. Đến nhà mấy lần, anh ta đều đi vắng. Tìm ở đâu cũng đều không thấy.

@đền
