- 2 đg. 1 Trả lại cho người khác tương xứng với sự tổn thất, thiệt hại mà mình gây ra. Đền tiền. Bắt đền*. 2 Trả lại cho người khác tương xứng với công của người đó đối với mình. Đền ơn. Đền công khó nhọc.

